import './AppHeader.css';
const students = [
    { name: 'John', age: 10 },
    { name: 'Victor', age: 40 }
]

function AppHeader() {
    return (
        <div>
            {students.map(function (item) {
                return <p>{item.name} <span>{item.age}</span></p>
            })}
            <div className="box_1">B

                <div className='box_2'>jumbotron example</div>
            </div>
        </div>

    )
}
export default AppHeader;
